import React, { useState } from 'react'


const Hourly = ({ hour }) => {
  const [time, setTime] = useState(Date(hour.time * 1000));

  return (
    <div>
      <h6>{setTime(time.getHours())}</h6>
    </div>
  )
}

export default Hourly
